import styled from "styled-components";

export const Container = styled.div`
  background-color: red;
  color: black;
  position: relative;

  .modalWrapper {
    position: absolute;
    width: 100vw;
    height: 45vh;
    left: calc(-59vw + 40%);
    background-color: red;
    bottom: 2em;
  }
`;
